import 'package:json_annotation/json_annotation.dart';import 'sub_category.dart';part 'service_model.g.dart'; @JsonSerializable(nullable: false,)class ServiceModel {  @JsonKey(name: 'id')  final int? id;  @JsonKey(name: 'name')  final String? name;  @JsonKey(name: 'code')  final  String? code;  @JsonKey(name: 'logo')  final String? logo;  @JsonKey(name: 'subCategory')  final List<SubCategory> ? subCategory;  ServiceModel({required this.id, required this.name, required this.code, required this.logo, required this.subCategory});   factory ServiceModel.fromJson(Map<String, dynamic> json) => _$ServiceModelFromJson(json);   Map<String, dynamic> toJson() => _$ServiceModelToJson(this);}